    function handleUpload1(file) {
        let isTrue = "";
        let FileExt = file.name.replace(/.+\./, "");
        //验证图片格式
        if (["xls", "xlsx","doc","docx"].indexOf(FileExt.toLowerCase()) === -1) {
            isTrue = false;
        } else {
            isTrue = true;
        }
        if (!isTrue) {
            message.error("只能上传xls、xlsx、doc、docx");
            return
        }

        //测试报告
        if(uploadType === "test_report"){
            setFileListReport({
                ...fileListReport, file
            });
        }
        //测试用例
        if(uploadType === "test_case"){
            setFileListTestCase({
                ...fileListTestCase, file
            });
        }

        return false;
    }


